import React from "react";
import { TestDataCompany } from "../Table/testData";
import { render } from "@testing-library/react";

type Props = {};

const data = TestDataCompany[0];

type Company = typeof data;

const config = [
  {
    Label: "Company Date",
    render: (company: Company) => company.companyName,
    subTitle: "This is the company name",
  },
];

const RatioList = (props: Props) => {
  const renderedRows = config.map((row) => {
    return (
      <li className="py-3 sm:py-4">
        <div className="flex item-center space-x-4">
          <div className="flex-1 min-w-0">
            <p className="text-sm fontmt-medium text-gray truncate">
              {row.Label}
            </p>
            <p className="text-sm text-gray-500 truncate">
              {row.subTitle && row.subTitle}
            </p>
          </div>
          <div className="inline-flex items-center text-base font-demibold text-grey-900">
            {row.render(data)}
          </div>
        </div>
      </li>
    );
  });
  return (
    <div className="bg-white shadow rounded-lg mb-4 p-4 sm:p-6 h-full">
      <ul className="divide-y devided-gray-200">{renderedRows}</ul>
    </div>
  );
};

export default RatioList;
